import React from 'react'
import { FaMagic, FaQuoteLeft } from 'react-icons/fa'

export const Home = () => {
  return (
    <div>
      <h2>Welcome to <strong>The Great Kirigalan Magic Show! &nbsp;<FaMagic></FaMagic></strong></h2>
      <img src='https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fi.ytimg.com%2Fvi%2Ff5m0ohi9mws%2Fmaxresdefault.jpg&f=1&nofb=1&ipt=ade743d4d63cb05c43e61cc1ade846feb5cb6dd0897e927a42d85a243dd0e19f&ipo=images' height={300} width={550} alt='Great Kirigalan Magic show' />
    </div>
  )
}
